import React from 'react';
var axios = require("axios").default;

function HotelList(props) {

    var options = {
        method: 'GET',
        url: 'https://hotels4.p.rapidapi.com/properties/list',
        params: {
          destinationId: '1506246',
          pageNumber: '1',
          pageSize: '25',
          checkIn: '2020-01-08',
          checkOut: '2020-01-15',
          adults1: '1',
          sortOrder: 'PRICE',
          locale: 'en_US',
          currency: 'USD'
        },
        headers: {
          'x-rapidapi-host': 'hotels4.p.rapidapi.com',
          'x-rapidapi-key': 'fc1f1ff2d3mshe2267e55a9681dfp1c29e0jsnfc471925dd78'
        }
      };
    
    let dataResults;
    axios.request(options).then(function (response) {
        dataResults = response.data.data.body.searchResults;
    }).catch(function (error) {
        console.error(error);
    });

    return (
        <div>
          {/* <ul>
            {data.map(item => (
                <li key={item.searchResults.results}>
                    Name:
                       <span>{item.searchResults.results.name}</span>
                    Stars: 
                       <span>{item.searchResults.results.starRating}</span>
                </li>   
            ))}
            </ul> */}
        </div>
    );
}

export default HotelList;
